# ~ dynamic programming
def lgis(seq):
    T = [1] * len(seq)
    for i in range(0, len(seq)):
        if i == 0:
            continue
        for j in range(0, i):
            if int(seq[i]) > int(seq[j]):
                T[i] = max(T[i], T[j]+1)

    l = max(n for n in T)
    sub=[]
    s = 0
    Tr = T[::-1]
    seqr = seq[::-1]
    for n in range(l, 0, -1):
        for i in range(s, len(T)):
            if Tr[i] == n:
                sub.insert(0, seqr[i])
                s = i
                break
    return ' '.join(sub)
    

def lgds(seq):
    T = [1] * len(seq)
    for i in range(0, len(seq)):
        if i == 0:
            continue
        for j in range(0, i):
            if int(seq[i]) < int(seq[j]):
                T[i] = max(T[i], T[j]+1)
    
    l = max(n for n in T)
    sub=[]
    s = 0
    Tr = T[::-1]
    seqr = seq[::-1]
    for n in range(l, 0, -1):
        for i in range(s, len(T)):
            if Tr[i] == n:
                sub.insert(0, seqr[i])
                s = i
                break
